        private static void PopulateException<T>(T exception)
            where T : Exception
        {
            exception.HelpLink = "http://msdn.microsoft.com";
            exception.Source = "Exception_Class_Samples";

            exception.Data.Add("secret", true);
            exception.Data.Add(1, "one");

            // Exceptions are reflection blocked in uapaot
            if (!PlatformDetection.IsNetNative)
            {
                typeof(Exception)
                    .GetField("_stackTraceString", BindingFlags.Instance | BindingFlags.NonPublic)
                    .SetValue(exception, "StackTrace string...");
                typeof(Exception)
                    .GetField("_HResult", BindingFlags.Instance | BindingFlags.NonPublic)
                    .SetValue(exception, 1000);
                typeof(Exception)
                    .GetField("_remoteStackTraceString", BindingFlags.Instance | BindingFlags.NonPublic)
                    .SetValue(exception, "Remote StackTrace string...");
            }
        }

        public static IEnumerable<object> NonSerializableObjects_MemberData()
        {
            yield return new NonSerializableStruct();
            yield return new NonSerializableClass();
            yield return new SerializableClassWithBadField();
            yield return new SerializableClassDerivedFromNonSerializableClass();
            yield return new object[] { 1, 2, 3, new NonSerializableClass() };
        }

        public static IEnumerable<object[]> BasicObjectsRoundtrip_MemberData()
        {
            foreach (object[] record in SerializableObjects_MemberData())
            {
                foreach (FormatterAssemblyStyle assemblyFormat in new[] { FormatterAssemblyStyle.Full, FormatterAssemblyStyle.Simple })
                {
                    foreach (TypeFilterLevel filterLevel in new[] { TypeFilterLevel.Full, TypeFilterLevel.Low })
                    {
                        foreach (FormatterTypeStyle typeFormat in new[] { FormatterTypeStyle.TypesAlways, FormatterTypeStyle.TypesWhenNeeded, FormatterTypeStyle.XsdString })
                        {
                            yield return new object[] { record[0], assemblyFormat, filterLevel, typeFormat };
                        }
                    }
                }
            }
        }

        public static IEnumerable<object[]> NonSerializableTypes_MemberData()
        {
            foreach (object obj in NonSerializableObjects_MemberData())
            {
                foreach (FormatterAssemblyStyle assemblyFormat in new[] { FormatterAssemblyStyle.Full, FormatterAssemblyStyle.Simple })
                {
                    foreach (TypeFilterLevel filterLevel in new[] { TypeFilterLevel.Full, TypeFilterLevel.Low })
                    {
                        foreach (FormatterTypeStyle typeFormat in new[] { FormatterTypeStyle.TypesAlways, FormatterTypeStyle.TypesWhenNeeded, FormatterTypeStyle.XsdString })
                        {
                            yield return new object[] { obj, assemblyFormat, filterLevel, typeFormat };
                        }
                    }
                }
            }
        }

